column2776:
29/May/25 11:10 PM;712020:a76c41c5-a31f-4548-8c22-27508989206c;Tried one of the fix to avoid SSRF in which created two function named as sanitizeHeaders(headers) and isSafeHost(url).

 

* isSafeHost function checks if the URL is safe to send a request to.
* sanitizeHeaders removes any unwanted or dangerous headers that an attacker might try to send.

{{ function sanitizeHeaders(headers) {}}

{{    const allowedHeaders = ['Accept', 'Content-Type', 'DataServiceVersion', 'MaxDataServiceVersion'];}}

{{    const sanitized = {};}}

{{ }}

{{    for (const key in headers) {}}

{{        if (headers.hasOwnProperty(key)) {}}

{{            const normalizedKey = key.trim();}}

{{            if (allowedHeaders.includes(normalizedKey)) {}}

{{                sanitized[normalizedKey] = headers[key];}}

{{            }}}

{{        }}}

{{    }}}

{{     return sanitized;}}

{{}}}

{{function isSafeHost(url) {}}

{{    try {}}

{{        const parsed = new URL(url);}}

{{        const hostname = parsed.hostname.toLowerCase();}}

{{ }}

{{        if (}}

{{            hostname === 'localhost' ||}}

{{            hostname === '127.0.0.1' ||}}

{{            hostname === '::1' ||}}

{{            hostname.startsWith('169.254.') ||}}

{{            hostname.startsWith('10.') ||}}

{{            hostname.startsWith('192.168.') ||}}

{{            /^172\.(1[6-9]|2[0-9]|3[0-1])\./.test(hostname)}}

{{        ) {}}

{{            return false;}}

{{        }}}

{{ }}

{{        return true;}}

{{    } catch (e) {}}

{{        return false;}}

{{    }}}

{{}}}

*This fix couldn't resolve the issue , trying some other fixes to avoid SSRF*.

